import React from 'react'
import { ListGroup, ListGroupItem, ListGroupItemHeading, ListGroupItemText, Container } from 'reactstrap'

const ApartmentIndex = props => {
  return(
    <>
      <h3>Your Apartment Listings</h3>
      <Container>
      <ListGroup>
        {props.apartments.map((apartment,index) => {
          return(
            <ListGroupItem>
              <ListGroupItemHeading>{ apartment.subject }</ListGroupItemHeading>
              <ListGroupItemText>
              { apartment.description }
              </ListGroupItemText>
            </ListGroupItem>
          )
        })}
      </ListGroup>
      </Container>
    </>
  )
}

export default ApartmentIndex
